import React, { useState, useEffect } from 'react';
import './Gallery.css';

const Gallery = () => {
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [isModalOpen, setIsModalOpen] = useState(false);

  // Sample data - Replace with actual image URLs
  const galleryData = {
    venue: [
      { src: 'venue1.jpg', text: 'Elegant Wedding Venue' },
      { src: 'venue2.jpg', text: 'Grand Wedding Venue' },
      { src: 'venue3.jpg', text: 'Beautiful Open Venue' },
      { src: 'venue4.jpg', text: 'Traditional Wedding Venue' },
      { src: 'venue5.jpg', text: 'Luxury Wedding Venue' },
      { src: 'venue6.jpg', text: 'Rooftop Wedding Venue' },
    ],
    decor: [
      { src: 'decor1.jpg', text: 'Traditional Indian Decor' },
      { src: 'decor2.jpg', text: 'Luxury Floral Setup' },
      { src: 'decor3.jpg', text: 'Sculptured Wedding Setup' },
      { src: 'decor4.jpg', text: 'Elegant Stage Design' },
      { src: 'decor5.jpg', text: 'Vintage Wedding Decor' },
      { src: 'decor6.jpg', text: 'Contemporary Wedding Design' },
    ],
    // Add more categories like food, photography...
  };

  // Function to open modal
  const openModal = () => {
    setIsModalOpen(true);
  };

  // Close modal
  const closeModal = () => {
    setIsModalOpen(false);
  };

  // Filter data based on selected category
  const filteredData = selectedCategory === 'all' 
    ? [...galleryData.venue, ...galleryData.decor] // Add more categories
    : galleryData[selectedCategory];

  useEffect(() => {
    const scrollInterval = setInterval(() => {
      const galleryContainer = document.querySelector('.gallery-scroll-container');
      galleryContainer.scrollBy({
        left: 300, // Change this value to scroll faster/slower
        behavior: 'smooth',
      });
    }, 3000); // Scroll interval for auto-scroll

    return () => clearInterval(scrollInterval);
  }, []);

  return (
    <div className="gallery-container">
      <div className="gallery-header">
        <h2>Our Masterpieces</h2>
        <p>Explore the stunning wedding celebrations we've crafted.</p>
      </div>

      {/* Gallery Categories */}
      <div className="gallery-categories">
        <button className="category-btn" onClick={() => setSelectedCategory('venue')}>Venue</button>
        <button className="category-btn" onClick={() => setSelectedCategory('decor')}>Decor</button>
        {/* Add other categories like food, photography */}
        <button className="category-btn" onClick={() => setSelectedCategory('all')}>All</button>
      </div>

      {/* Gallery Scroll Section with Auto-scroll */}
      <div className="gallery-scroll-container">
        {filteredData.slice(0, 5).map((item, index) => (
          <div className="gallery-item" key={index}>
            <img src={item.src} alt={item.text} className="gallery-img" />
            <div className="overlay">
              <div className="text">{item.text}</div>
            </div>
          </div>
        ))}
      </div>

      <button className="show-all-btn" onClick={openModal}>Show All</button>

      {/* Modal for displaying all images */}
      {isModalOpen && (
        <div className="modal">
          <div className="modal-content">
            <span className="close-btn" onClick={closeModal}>&times;</span>
            <h3>All {selectedCategory} Images</h3>
            <div className="gallery-grid">
              {filteredData.map((item, index) => (
                <div className="gallery-item" key={index}>
                  <img src={item.src} alt={item.text} className="gallery-img" />
                  <div className="overlay">
                    <div className="text">{item.text}</div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Gallery;
